import React, {useState} from "react";

import Box from "@mui/material/Box"
import Tab from '@mui/material/Tab';
import Tabs from '@mui/material/Tabs';

function Result_post(props)
{
    const [full_data, set_full_data] = useState(props.data.current);
    const [tab_value, set_tab_value] = useState(0);

    const [result_data, set_result_data] = useState();
    //console.log(full_data.date);

    function tab_change(e, value)
    {
        set_tab_value(value);
        //set_frame_list(full_data[value]);
    }


    return (
        <Box sx={{display: "flex", width: "100%", flexDirection: "column"}}>
            <Box sx={{borderBottom: 1, borderColor: 'divider',  width: "100%"}}>
                <Tabs value={tab_value} onChange={tab_change}>
                    {
                        full_data.item.map((element, index) => (
                            <Tab key={element.id} value={index} label={element.name}/>
                    ))
                    }
                    
                </Tabs>

                
            </Box>
            <Box sx={{ overflowY: "scroll", flexGrow: 1}}>

            </Box>
            
        </Box>
    )
}

function Global_result(props)
{
    

}

function Stock_frame_result(props)
{
    const [full_data, set_full_data] = useState();
    let my_money = 0;
    let my_need_money = 0;
    let my_per = 0;
    let my_need_per = 0;

    my_money = full_data.money;
    my_per = my_money / props.full_money;
    my_need_per = full_data.wantper - my_per;
    my_need_money = props.full_money * (full_data.wantper / 100) - my_money;

    return (
        <>
        {
            full_data.item.map((element) => (
                <Stock_result key={element.id} full_money={my_money} ele={element}/>
            ))
        }
        </>
    )
}

function Stock_result(props)
{
    const [full_data, set_full_data] = useState(props.element);
    let my_money = 0;
    let my_need_money = 0;
    let my_per = 0;
    let my_need_per = 0;

    my_money = full_data.money;
    my_per = my_money / props.full_money;
    my_need_per = full_data.wantper - my_per;
    my_need_money = props.full_money * (full_data.wantper / 100) - my_money;
    return (
        <>
        </>
    )
}

export default Result_post;
